import React from 'react'
import styled from 'styled-components'
import Announcement from '../components/Announcement';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
const Container = styled.div`
  
`;
const Wrapper = styled.div`
  padding: 20px;
`;
const Title = styled.h1`
  font-weight: 300;
  text-align: center;
`;
const Top = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;
const TopButton = styled.button`
  padding: 10px;
  font-weight: 600;
  cursor: pointer;
  border: ${props=>props.type==="filled" && "none"};
  background-color: ${props=>props.type==="filled" ? "black" : "transparent"};
  color: ${props=>props.type==="filled" && "white"};
`;
const TopTexts = styled.div`
  
`;
const TopText = styled.span`
  text-decoration: underline;
  cursor: pointer;
  margin: 0px 10px;
`;
const Bottom = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;
const Info = styled.div`
  flex: 3;
`;
const Product = styled.div`
  
`;
const ProductDetail = styled.div`
  
`;
const Image = style
const Summary = styled.div`
  flex: 1;
`;
const Cart = () => {
  return (
   <Container>
    <Announcement/>
    <Navbar/>
    <Wrapper>
      <Title>YOUR BAG</Title>
      <Top>
        <TopButton type="filled">CONTINUE SHOPING</TopButton>
        <TopTexts>
          <TopText>SHOPING BAG(2)</TopText>
          <TopText>YOUR WISHLIST(0)</TopText>
        </TopTexts>
        <TopButton>CHECK OUT NOW</TopButton>
      </Top>
      <Bottom>
        <Info>
          <Product>
            <ProductDetail>
              <Image src=""/>
              <Details>
                <ProductName><b>Product:</b> JESSI THUNDER SHOES</ProductName>
                <ProductId><b>ID:</b>123456789</ProductId>
                <ProductColor/>
                <ProductSize><b>Size:</b> 37.5</ProductSize>
              </Details>
            </ProductDetail>
            <PriceDetail></PriceDetail>
          </Product>
        </Info>
        <Summary>Summary</Summary>
      </Bottom>
    </Wrapper>
    <Footer/>

   </Container>

  )
}

export default Cart
